export const simpleAction = () => dispatch => {
fetch('http://example.com/movies.json')
  .then((response) => {
    return response.json();
  })
  .then((data) => {
    console.log(data);
  });

    dispatch({
      type: 'SIMPLE_ACTION',
      payload: 'result_of_simple_action'
    })
  }
